import React from "react";
import { FaGithub } from "react-icons/fa";
import "../Footer/footer.css";

function Footer() {
  return (
    <div className="footer">
      <a className="footerLinks" href="#">
        <FaGithub />
      </a>
    </div>
  );
}

export default Footer;
